function ExpnseDate () {
    const year = props.date.getFullYear();
    const month = props.date.getMonth();
    const day = props.date.getDate();

    return (
        <div className="expense-time">
        <div className="divs">{day}</div>
        <div className="divs">{month}</div>
        <div className="divs">{year}</div>
      </div>
    )
}

export default ExpnseDate;
